    left, right = 0, len(arr) - 1

    while left <= right:
        mid = (left + right) // 2

        if arr[mid] == target:
            return True

        elif arr[mid] < arr[left]:
            # Target is in the lower half of the array
            if arr[mid] < target <= arr[left]:
                right = mid - 1
            else:
                left = mid + 1

        else:
