    result = 0
    index = 0
    sign = 1

    while index < len(s) and s[index].isspace():
        index += 1

    if index == len(s):
        return result

    for char in s[index:]:
        if char in ['+', '-']:
            sign *= -1 if char == '-' else 1
            index += 1
        elif char.isdigit():
            digit = int(char)
            while index < len(s) and s[index].isdigit():
                digit = 10 * digit + int(s[index])
                index += 1
            result *= sign
            result += digit
        else:
